@kennknowles It seems there is actually no check for a merging window strategy with a stateful `DoFn`. This little example runs on the `DirectRunner`, not sure about the `DataflowRunner`:

```
PipelineOptions options = PipelineOptionsFactory.create();
options.setRunner(DirectRunner.class);
Pipeline pipeline = Pipeline.create(options);

pipeline
    .apply(CountingInput.unbounded())
    .apply(ParDo.of(new DoFn<Long, KV<String, Long>>() {
      @ProcessElement
      public void p(ProcessContext c) {
        c.output(KV.of("ciao", c.element()));
      }
    }))
    .apply(Window.<KV<String, Long>>into(Sessions.withGapDuration(Duration.standardSeconds(3))))
    .apply(ParDo.of(new DoFn<KV<String, Long>, String>() {

      @StateId("my-state")
      final StateSpec<Object, BagState<Long>> bag = StateSpecs.bag(VarLongCoder.of());

      @ProcessElement
      public void p(ProcessContext c, @StateId("my-state") BagState<Long> myState) {
        myState.add(c.element().getValue());

        System.out.println("SO FAR: " + myState.read());
      }
    }));

pipeline.run();
```

The `StatefulDoFnRunner` should probably reject such cases, though.
